"use strict";(self.webpackChunksf_documentation=self.webpackChunksf_documentation||[]).push([[1206],{8344:function(e){e.exports=JSON.parse('{"title":"Tracing in SnappyFlow","description":"SnappyFlow supports distributed tracing compliant with Opentracing standard. Tracing allows users to visualize the sequence of steps a transaction (whether API or non-API such as a Celery job) takes during its execution. This analysis is extremely powerful and allows pinpointing the source of problems such as abnormal time being spent on an execution step or identifying point of failure in a transaction. SnappyFlow refers to distributed tracing as sfTrace.","slug":"/category/tracing","permalink":"/docs/category/tracing","navigation":{"previous":{"title":"SnappyFlow sfPoller Setup In Azure","permalink":"/docs/sfPoller/azure_setup"},"next":{"title":"Java tracing","permalink":"/docs/Tracing/java"}}}')}}]);